import { useEffect, useState } from "react";
import "./Home.css"





function EmpData1(event) {


    const [data, setData] = useState([])

    useEffect(() => {
        fetch("http://localhost:3006/subscription")
            .then((res) => {
                return res.json()
            })
            .then((resp) => {
                console.log(resp)

                setData(resp)
            })
    }, [])
    return (
        <div>
            <nav class="navbar bg-dark border-bottom border-body" data-bs-theme="danger" style={{ padding: "50px" }}>
                
                    <div class="container-fluid">
                        <a class="navbar-brand">Navbar</a>
                        <form class="d-flex" role="search">
                            <input class="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
                            <button class="btn btn-outline-success" type="submit">Search</button>
                        </form>
                    </div>
            </nav>
            
            <h1 style={{ textAlign: "center" }}>CLOTHES FOR MENS & WOMENS</h1>
            <div id="sun" >


                {data.map((item) => (
                    <div className="card" style={{ width: "18rem" }}>

                        <img src={item.img} class="card-img-top" alt="..." style={{ height: "300px" }} />

                        <div className="card-body">

                            <h5 className="card-title">{item.brand}</h5>
                            <p className="card-text">{item.size}</p>
                            <p>{item.description}</p>
                            <p >{item.price}</p>
                            <a href="#" className="btn btn-primary">Add To Cart (+)</a>
                        </div>
                    </div>
                ))}
            </div>
        </div>


    )
}

export default EmpData1;
